import './App.css';
import Login from './components/Login';
import { Route, Switch, BrowerRouter } from 'react-router-dom';

function App() {
  return <BrowerRouter>
    <Switch>
      <Route component={Login} path="login" />

    </Switch>
  </BrowerRouter>
}

export default App;
